Reconhecimento dos objetos quotidianos

A. Reconhecimento com pistas;

B. Reconhecimento sem pistas

A partir de uma notícia do jornal os participantes deverão:

1. Explicar o que se recorda daquela informação;
2. Responder a perguntas sobre a noticia;
3. Dar a opinião pessoal sobre a noticia lida.
